{'name': {'type': 'string', 'description': 'Slipstream 009'}, 'description': {'type': 'string', 'description': 'Slipstream fiction, trafficking in "the familiar strange or the strange familiar" via “epistemological and ontological questionings about reality,” [1] provides the conceptual framework for these mutated artworks. Evolutionarily speaking, each of us perceives our own distinct individual realities and are indelibly influenced by those shared with us. While invented truths are often deployed broadly for the purposes of oppression, disinformation campaigns and mass manipulation, this series embraces the ever-changing concept of truth itself. Each hybridized artwork in the series toys with and dwells in the murky territories of consciousness. Additive and subtractive in their construction, these transmutations embody a self-organizing logic.

'Slipstream' artworks begin as graphite drawings on paper, launching a long odyssey of production. The drawings are torn into pieces and then reconfigured in bespoke sculptural configurations. Echoing recombinant DNA, each sculptural installation represents an iterative version of the one before. Documented as 3D objects, they are altered, lit and animated using CG software. Once composited, they exist as discrete looped videos (aka, this NFT). A final step returns them to paper --forever altered-- as archival prints, in triptychs, which isolate sequential dramatic moments in their respective animations. These artworks gesture towards the organic, as simulated fictions of botanical forms. Each offers a familiar referent with no natural analogue.

1] Kelly, James Patrick, Kessel, John (2006). Feeling Very Strange, xi,xiii. Tachyon Publications. ISBN 978-1-892391-35-x'}, 'image': {'type': 'string', 'description': 'https://monegraph.mypinata.cloud/ipfs/QmYn6hzms5pkkXQ6FaHaNhza9atP8qRpquNTMc7Di922h9/slipstream009_small.png'}, 'rights_agreement': {'type': 'string', 'description': 'https://ipfs.io/ipfs/QmXRM5RGyefiNmVG2P1ePrCLmEJjfrgDZMQ34zGHsaAHkd'}, 'rights_agreement_signature_type': {'type': 'string', 'description': 'SHA-256'}, 'rights_agreement_signature': {'type': 'string', 'description': 'b0db44f3f9a97ae025cb8fe702e95fce410e27e440199277d136fb09378e10d4'}, 'archive_link': {'type': 'string', 'description': 'https://monegraph.mypinata.cloud/ipfs/slipstream009.nancybakercahill.com'}, 'archive_link_signature_type': {'type': 'string', 'description': 'SHA-256'}, 'archive_link_signature': {'type': 'string', 'description': '995cde7d5d6bba4f89801d7ba0ac3484fe8b54ea19b7dbbe325b987bec64f8e3'}, 'rights_agreement_values': {'$ARTIST': 'Nancy Baker Cahill', '$SHAHASH': '995cde7d5d6bba4f89801d7ba0ac3484fe8b54ea19b7dbbe325b987bec64f8e3', '$URL': 'https://monegraph.mypinata.cloud/ipfs/QmYn6hzms5pkkXQ6FaHaNhza9atP8qRpquNTMc7Di922h9/slipstream009_small.png', '$TITLE': 'Slipstream 009', '$YEAR': '2021', '$ROYALTYRATE': '10', '$ADDRESS': '0x913107F823135a4189c16b55e5354854Cbdc0dcf', '$TOKEN': 'eth', '$LICENSE': 'CA.05.19.21., Patent No. US 10,380,702', '$CONTRACTSHAHASH': 'b0db44f3f9a97ae025cb8fe702e95fce410e27e440199277d136fb09378e10d4'}}
